INSERT INTO `quiz_oj_problem` VALUES (1, '斐波那契数列', '2020年1月，中国武汉地区爆发不明原因肺炎感染。当地卫生监测部门对感染人数进行密切监控。某医院根据最近的确诊人数变化趋势发现，新型肺炎的感染人数以近似斐波那契数列的方式增长。第一天感染人数为1，第二天感染人数为1，第三天感染人数为2，以此类推。现医院管理人员需要预测未来确诊人数以决定是否增添新的床位。求：第n天确诊感染人数。', 2, 1, 0, '2020-05-16 21:06:56', '2020-05-16 21:06:56');
INSERT INTO `quiz_oj_problem` VALUES (2, '加法练习', '新冠肺炎疫情期间，监管人员需要经常核对运往武汉地区物资的账本信息，然而频繁的数字运算耗费了其大量时间。我们将编写简单程序帮助其完成数学加法运算。求：输入两数字的和并将其输出。', 2, 1, 0, '2020-05-16 21:07:00', '2020-05-16 21:07:00');
INSERT INTO `quiz_oj_problem` VALUES (3, '无重复字符的最长子串', '对抗疫情，时间就是生命。抗击肺炎过程中医疗物资配送效率十分重要，为此，研究小组专门调研了某医疗物资配送车一天以内的行程，并将其行程以字符串的形式表示出来。如：abcda表示其依次经过地区a、b、c、d、a。现为提高配送效率，我们希望找到配送车在不重复的情况下最多经过多少地区，如abcabcbb，则最长无重复路径长度为3。请根据给定的行程轨迹（字符串）求：最长无重复路径长度。\r\n\r\n        示例 1:\r\n\r\n        输入: \"abcabcbb\"\r\n        输出: 3\r\n        解释: 因为无重复字符的最长子串是 \"abc\"，所以其长度为 3。\r\n        示例 2:\r\n\r\n        输入: \"bbbbb\"\r\n        输出: 1\r\n        解释: 因为无重复字符的最长子串是 \"b\"，所以其长度为 1。\r\n        示例 3:\r\n\r\n        输入: \"pwwkew\"\r\n        输出: 3\r\n        解释: 因为无重复字符的最长子串是 \"wke\"，所以其长度为 3。\r\n             请注意，你的答案必须是 子串 的长度，\"pwke\" 是一个子序列，不是子串。', 3, 1, 1, '2020-05-16 20:54:49', '2020-05-16 20:54:49');
INSERT INTO `quiz_oj_problem` VALUES (4, '快乐数', '随着疫情的持续，病房中患者的情绪渐渐消沉。为缓解病人的焦虑情绪，从小对数字特别敏感的护士小姐想出了一个游戏，用以消磨病人的时光，为他们带来快乐的情绪：对于一个正整数，每一次将该数替换为它每个位置上的数字的平方和，然后重复这个过程直到这个数变为 1，也可能是 无限循环 但始终变不到 1。如果 可以变为 1，那么这个数就是快乐数。你的任务是：求护士小姐给定的数n是否为快乐数。\r\n\r\n示例：\r\n\r\n输入：19\r\n输出：true\r\n解释：\r\n12 + 92 = 82\r\n82 + 22 = 68\r\n62 + 82 = 100\r\n12 + 02 + 02 = 1', 3, 1, 0, '2020-05-16 20:55:06', '2020-05-16 20:55:06');
INSERT INTO `quiz_oj_problem` VALUES (5, 'Z 字形变换', '疫情爆发初期疑似患者人数数量巨大，这为医院的管理工作带来了很大麻烦。为提高管理效率，管理者提出这样一种策略：要求前来就诊的患者按从前到后，从左至右的顺序按Z字形排列；而医护信息统计人员则从左至右逐排统计患者信息。现用一个英文字母代表一个患者，给定字符串即代表患者就诊顺序；给定行数n为每一排可站人数。求给定n情况下医护信息统计结果。\r\n\r\n如输入：LEETCODEISHIRING，n=3：\r\n排列如下：\r\nL    C     I     R\r\nE T O E S  I  I  G\r\nE    D     H    N\r\n统计结果为：\r\nLCIRETOESIIGEDHN\r\n\r\n示例 1:\r\n输入: s = \"LEETCODEISHIRING\", numRows = 3\r\n输出: “LCIRETOESIIGEDHN\"\r\n\r\n示例 2:\r\n输入: s = \"LEETCODEISHIRING\", numRows = 4\r\n输出: \"LDREOEIIECIHNTSG\"\r\n解释:\r\n\r\nL     D     R\r\nE   O E   I I\r\nE C   I H   N\r\nT     S     G', 3, 1, 1, '2020-05-16 20:55:23', '2020-05-16 20:55:23');
INSERT INTO `quiz_oj_problem` VALUES (6, '相似度为 K 的字符串', '对疑似患者的核酸检测是判断其是否感染的有效手段。在实际的检测过程中常常会检测到大量与新冠病毒核酸类似的核酸。为确定其究竟是否为新冠病毒，基因检查人员需要对检测到的核酸序列进行分析。现定义：核酸序列A（以字符串代表）若经k次精确的核苷酸位置交换得到核酸序列B，则称核酸A与核酸B的相似性为k。现给定两核酸序列，求两核酸序列的相似性。\r\n\r\n示例 1：\r\n\r\n输入：A = \"ab\", B = \"ba\"\r\n输出：1\r\n示例 2：\r\n\r\n输入：A = \"abc\", B = \"bca\"\r\n输出：2\r\n示例 3：\r\n\r\n输入：A = \"abac\", B = \"baca\"\r\n输出：2\r\n示例 4：\r\n\r\n输入：A = \"aabc\", B = \"abca\"\r\n输出：2\r\n \r\n\r\n提示：\r\n\r\n1 <= A.length == B.length <= 20\r\nA 和 B 只包含集合 {\'a\', \'b\', \'c\', \'d\', \'e\', \'f\'} 中的小写字母。', 3, 1, 2, '2020-05-16 20:55:44', '2020-05-16 20:55:44');
INSERT INTO `quiz_oj_problem` VALUES (7, '有效的括号', '临床证据显示，国产莲花清瘟胶囊对新冠肺炎轻症患者具有有效疗效。为满足持续扩大对用药需求，某制药厂开始加速赶制莲花清瘟胶囊。然而匆忙制造有可能发生流程错误的情况。我们用一组括号代表制药流程中的一组流程，制药流程的合理性原则遵循括号结合的合理性原则。比如说\r\n[ ( ) ]就代表一组有效流程，而 [ )代表一组无效流程。流程中操作用 ‘(‘，’)’，’{‘，’}’，\'[\'，\']\'足够完全表示。现给定流程序列（字符串），判断该流程最终生产出来的药物是否有效。\r\n\r\n示例 1:\r\n输入: \"()\"\r\n输出: true\r\n\r\n示例 2:\r\n输入: \"()[]{}\"\r\n输出: true\r\n\r\n示例 3:\r\n输入: \"(]\"\r\n输出: false\r\n\r\n示例 4:\r\n输入: \"([)]\"\r\n输出: false\r\n\r\n示例 5:\r\n输入: \"{[]}\"\r\n输出: true', 3, 1, 0, '2020-05-16 20:55:58', '2020-05-16 20:55:58');
INSERT INTO `quiz_oj_problem` VALUES (8, '最长有效括号', '受新冠肺炎疫情影响市场对莲花清瘟胶囊的需求不断增加，制药厂也在不断加快生产的脚步。现制药厂发现药物生产流程出现问题，需进行整改。我们用一组括号代表制药流程中的一组流程，制药流程的合理性原则遵循括号结合的合理性原则。比如说( ) 就代表一组有效流程，而 ) )代表一组无效流程。假定制药流程用 \'(\' 和 ‘)’足够完全表示。现给定一制药流程（字符串），求出其中有效流程的最大长度。\r\n示例 1:\r\n\r\n输入: \"(()\"\r\n输出: 2\r\n解释: 最长有效括号子串为 \"()\"\r\n示例 2:\r\n\r\n输入: \")()())\"\r\n输出: 4\r\n解释: 最长有效括号子串为 “()()\"', 3, 1, 2, '2020-05-16 20:56:12', '2020-05-16 20:56:12');
INSERT INTO `quiz_oj_problem` VALUES (9, '基本计算器', '随着各地医疗队、医疗物资逐步来到武汉，监管人员对武汉城内数据的管控要求也随之提高。现监管人员需要一个可以有效支持加减法及括号结合运算的计算器，请你帮助设计完成其逻辑计算功能。\r\n\r\n示例 1:\r\n\r\n输入: \"1 + 1\"\r\n输出: 2\r\n示例 2:\r\n\r\n输入: \" 2-1 + 2 \"\r\n输出: 3\r\n示例 3:\r\n\r\n输入: \"(1+(4+5+2)-3)+(6+8)\"\r\n输出: 23\r\n说明：\r\n\r\n你可以假设所给定的表达式都是有效的。\r\n请不要使用内置的库函数 eval', 3, 1, 2, '2020-05-16 20:56:25', '2020-05-16 20:56:25');
INSERT INTO `quiz_oj_problem` VALUES (10, '去除重复字母', '方舱医院为轻症患者提供有效的诊疗地点。驰援武汉的方医生接到一份诊治名单，其为所需诊疗的病人名单。由于名单上的病人来自不同病区，所以方医生需要依次赶往各个病区（a、b、c、d表示）。现给出病人所在病区的序列，求出方医生依次所需达到的病区。要求不能打乱其他字符的相对位置且求得序列的字典序最小。\r\n示例 1:\r\n\r\n输入: \"bcabc\"\r\n输出: \"abc\"\r\n示例 2:\r\n\r\n输入: \"cbacdcbc\"\r\n输出: “acdb\"', 3, 1, 2, '2020-05-16 20:56:36', '2020-05-16 20:56:36');
INSERT INTO `quiz_oj_problem` VALUES (11, '最长回文子串', '新冠肺炎病毒核酸序列的检测现已可以做到高效准确。对核酸序列检测的一个重要检测项便是核酸序列的“回文”特性。给定一病毒核酸序列，求其最大回文长度。\r\n示例 1：\r\n\r\n输入: \"babad\"\r\n输出: \"bab\"\r\n注意: \"aba\" 也是一个有效答案。\r\n示例 2：\r\n\r\n输入: \"cbbd\"\r\n输出: “bb\"', 3, 1, 1, '2020-05-16 20:57:19', '2020-05-16 20:57:19');
INSERT INTO `quiz_oj_problem` VALUES (12, '接诊', ' 方舱医院内，方医生今天上午共有n位病人需要接诊。方医生可以每次接诊一位患者或两位患者——当他疲累的时候可以选择一次只接诊一位患者。为保证接诊效率同时保证接诊效果，方医生需合理安排其接诊顺序。现根据上午共需接诊的患者人数n，确定方医生共有多少种不同的接诊方案。\r\n注意：给定 n 是一个正整数。\r\n\r\n示例 1：\r\n\r\n输入： 2\r\n输出： 2\r\n解释： 有两种方法。\r\n1.  1 + 1\r\n2.  2 \r\n示例 2：\r\n\r\n输入： 3\r\n输出： 3\r\n解释： 有三种方法。\r\n1.  1  + 1  + 1 \r\n2.  1  + 2 \r\n3.  2  + 1', 3, 1, 0, '2020-05-16 21:07:19', '2020-05-16 21:07:19');
INSERT INTO `quiz_oj_problem` VALUES (13, '计数质数', '疫情当前，运往武汉的物资需要尽快送达。对于需要分批送达的物资，我们需要合理安排运送批次。我们希望每一批物资可以尽量均匀地由不同途径送达，而这就要求物资的批次一定不能是质数。为解决这一问题我们要给出一个简单的程序，求出在给定物资数量的前提下，哪些批次安排是不可能做到均匀送达的（质数）\r\n示例:\r\n\r\n输入: 10\r\n输出: 4\r\n解释: 小于 10 的质数一共有 4 个, 它们是 2, 3, 5, 7', 2, 1, 0, '2020-05-16 21:07:22', '2020-05-16 21:07:22');
